  false,\n\t\"url\": null,\n\t\"notes\": \"The goal of this report is to summarize
  and assess the Predator Management Program from its inception in spring 1991 to
  fall 1996 to determine if the program is meeting its stated objectives., with an
  emphasis on increasing populations of the California clapper rail and reducing localized
  populations of the nonnative red fox. To facilitate analysis of trends in predators
  removed and to assess these patterns against the populations of the protected species,
  we summarized the data by species, areas, and time periods. For the red fox data,
  we used two approaches to understand the effect of trapping on fox populations:
  statistical analysis of spatial and temporal trends, and matrix modeling to estimate
  the potential reduction in fox populations. To assess the effect of fox removal
  on the clapper rail populations, we analyzed the relationships between measures
  of fox and clapper rail abundance.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
